import React, { Component } from 'react';
import './App.css';
import Button from './component/Button';
import axios from 'axios';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
    posts: []
    }
  }

  componentDidMount() {
    axios.get('https://test.wertkt.com/api/biz/')
    .then(response => {
      const posts = response.data.results.map(obj => ({name: obj.name}));
      this.setState({ posts });
    })
    .catch(error => {
      console.log(error);
    });
  }
  render(){
    return (
      <div className="box">
        <nav className="nav">
          <h1 className="nav__title">Dashboard</h1>
          <h2 className="nav__subtitle">Liste des entreprises :</h2>
          <ul>
            {this.state.posts.map(post => <li key={item.name} />)}

          </ul>
        </nav>
        <div className="dashboard">
          <p className="dashboard__title">Rechercher une entreprise</p>
          <input className="dashboard__input" type='text'/>
          <button className="dashboard__button">rechercher</button>
          <Button />
        </div>
      </div>
    );
  }
}

export default App;
